package com.gasmonitor.vo;/** * Created by saplmm on 2017/9/2. */public class BasDeviceUnitVo {    private String id;    private String unint;    public static BasDeviceUnitVo newBaseDeviceUnitVo(String id, String unint) {        BasDeviceUnitVo vo = new BasDeviceUnitVo();        vo.setId(id);        vo.setUnint(unint);        return vo;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getUnint() {        return unint;    }    public void setUnint(String unint) {        this.unint = unint;    }}